import React ,{Component} from 'react';
class Navbar extends Component {
    render(){
      return (
        <nav>     
            <div id='parent-with-flex-direction-row'>
                <div id='logo'>
                      VietTraverller
                </div>
                      <div class='child'>
                          <ul>
                              <li><a href='#'>Trang chủ</a></li>
                              <li><a href='#'>Giới thiệu</a></li>
                              <li><a href='#'>Liên hệ</a></li>
                          </ul>
                      </div>
                            <div id='account'>
                                <a href='#'>Account</a>
                            </div>     
              </div>
          </nav>);
  }
};

export default Navbar;
